import React, { useState, useEffect } from 'react';
import { eventsAPI, registrationsAPI } from '../services/api';
import { useAuth } from '../context/AuthContext';

const Events = () => {
  const [events, setEvents] = useState([]);
  const [loading, setLoading] = useState(true);
  const { user } = useAuth();

  useEffect(() => {
    loadEvents();
  }, []);

  const loadEvents = async () => {
    try {
      const response = await eventsAPI.getAll();
      setEvents(response.data.data || []);
    } catch (error) {
      console.error('Error loading events:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleRegister = async (eventId) => {
    try {
      await registrationsAPI.register(eventId);
      alert('üéâ Successfully registered for the event!');
      loadEvents();
    } catch (error) {
      alert('‚ùå Registration failed');
    }
  };

  if (loading) return <div style={styles.loading}>Loading events...</div>;

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Upcoming Events</h1>
      <div style={styles.eventsGrid}>
        {events.map(event => (
          <div key={event._id} style={styles.eventCard}>
            <h3 style={styles.eventTitle}>{event.title}</h3>
            <p style={styles.eventDescription}>{event.description}</p>
            <div style={styles.eventDetails}>
              <p><strong>Date:</strong> {new Date(event.date).toLocaleDateString()}</p>
              <p><strong>Time:</strong> {event.time}</p>
              <p><strong>Venue:</strong> {event.venue}</p>
              <p><strong>Category:</strong> {event.category}</p>
              <p><strong>Participants:</strong> {event.currentParticipants}/{event.maxParticipants}</p>
              {event.registrationFee > 0 && (
                <p><strong>Fee:</strong> ‚Çπ{event.registrationFee}</p>
              )}
            </div>
            {user?.role === 'student' && (
              <button
                style={{
                  ...styles.registerButton,
                  ...(event.currentParticipants >= event.maxParticipants ? styles.disabledButton : {})
                }}
                onClick={() => handleRegister(event._id)}
                disabled={event.currentParticipants >= event.maxParticipants}
              >
                {event.currentParticipants >= event.maxParticipants ? 'Event Full' : 'Register Now'}
              </button>
            )}
          </div>
        ))}
      </div>
    </div>
  );
};

const styles = {
  container: {
    padding: '40px',
    flex: 1,
  },
  title: {
    textAlign: 'center',
    marginBottom: '30px',
    color: '#fff',
  },
  eventsGrid: {
    display: 'grid',
    gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))',
    gap: '20px',
  },
  eventCard: {
    background: 'rgba(255,255,255,0.15)',
    borderRadius: '15px',
    padding: '20px',
    backdropFilter: 'blur(6px)',
  },
  eventTitle: {
    color: '#fff',
    marginBottom: '10px',
  },
  eventDescription: {
    color: '#f9f9f9',
    marginBottom: '15px',
  },
  eventDetails: {
    color: '#f9f9f9',
    fontSize: '14px',
  },
  registerButton: {
    marginTop: '15px',
    padding: '10px 20px',
    background: '#ffd369',
    border: 'none',
    borderRadius: '8px',
    cursor: 'pointer',
    fontWeight: 'bold',
    width: '100%',
  },
  disabledButton: {
    background: '#ccc',
    cursor: 'not-allowed',
  },
  loading: {
    textAlign: 'center',
    color: '#fff',
    fontSize: '18px',
    padding: '40px',
  },
};

export default Events;
